  - name: AMENDED CD
    number: '5'
    value: ' 2007'
  - value: ' with respect to the Committee''s  30 Day Post-General Report (10/19/06
      - 11/27/06).  1.  The descrepancies in the figures for the Summary and Detailed
      Summary Page were previously corrected by filing an Amended 30 Post-General
      Report (2006).  2.  The previoulsy reported date of receipt of several contributions
      were incorrect.  The Committee Treasurer previously reported the date of deposit
      of the contributions as the date of receipt.  This amended report correctly
      provides the dates that the contributions were received by the Committee or
      its agent.  3.  The address of the original vendor under the credit card split
      has been identified.  4.  The description ''Get-out-the-vote'' under a disbursement
      has been corrected to ''driving voters to the polls''.   The Committee Treasurer
      Notes that contributions from Realtors Political Action Commitee'
  - value: ' CULAC'
  - value: ' and DaimlerChrysler Political Support Committee appear to exceed allowable
